import React, {useState, useEffect} from "react";
import { UA } from "sip.js";

const Softphone = () => {
    const [sipClient, setSipClient] = useState(null);
    const [session, setSession] = useState(null);

    useEffect(() => {
        // Create SIP client
        const client = new UA({
            uri: `sip:200-dataocean@82.166.96.228`,
            authorizationUser: "200-dataocean",
            password: "password123",
            transportOptions: {
                wsServers: ["ws://82.166.96.228:5066"],
            },
        });
        setSipClient(client);

        // Start SIP client
        client.start();

        // Register SIP client
        client.on("registered", () => {
            console.log("SIP client registered");
        });

        // Handle incoming calls
        client.on("invite", (incomingSession) => {
            setSession(incomingSession);

            // Answer incoming call
            incomingSession.accept({
                mediaConstraints: { audio: true, video: false },
            });

            // Handle call events
            incomingSession.on("progress", () => {
                console.log("Call in progress");
            });
            incomingSession.on("accepted", () => {
                console.log("Call accepted");
            });
            incomingSession.on("failed", () => {
                console.log("Call failed");
            });
            incomingSession.on("terminated", () => {
                console.log("Call terminated");
                setSession(null);
            });
        });
    }, []);

    // Make outgoing call
    const makeCall = () => {
        const destination = "sip:destination@example.com";
        const outgoingSession = sipClient.invite(destination, {
            mediaConstraints: { audio: true, video: false },
        });

        // Handle call events
        outgoingSession.on("progress", () => {
            console.log("Call in progress");
        });
        outgoingSession.on("accepted", () => {
            console.log("Call accepted");
        });
        outgoingSession.on("failed", () => {
            console.log("Call failed");
        });
        outgoingSession.on("terminated", () => {
            console.log("Call terminated");
        });
    };

    // Hang up call
    const hangUp = () => {
        session.terminate();
    };

    return (
        <div>
            <button onClick={makeCall}>Make call</button>
            {session && <button onClick={hangUp}>Hang up</button>}
        </div>
    );
};

export default Softphone;
